import React, { Component } from "react";

import "./AboutAlgorithm.css";

export default class AboutDFS extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">Depth-First-Search</h3>
        <img
          className="algorithm-image"
          src={require("./../../gifs/dfsslow.gif")}
        ></img>
        <p className="paragraph">
          The Depth-First-Search, while very applicable and useful in many
          situations, is not a great algorithm for pathfinding. The DFS has the
          characteristic of exploring whatever it sees first. When a node is
          visited it will be removed from the queue. BFS may be slower than
          others with heuristics but it is easier to implement. However, it is
          still very effective in producing an accurate shortest path.
          <br /> The code for the implementation of BFS can be found here:&nbsp;
          <a
            href="https://github.com/ignlg/heap-js/blob/master/dist/heap-js.es5.js"
            target="_blank"
          >
            Breath-First-Search
          </a>
        </p>
        <button
          className="next"
          onClick={() => {
            this.props.close();
          }}
        >
          Close
        </button>
      </div>
    );
  }
}
